import React from 'react';
function MovieDescription({frameUrl}) {
    return (
        <div>
            <iframe
                width="853"
                height="480"
                src={frameUrl}
                frameBorder="0"
                allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                allowFullScreen
                title="Embedded youtube"
            />
        </div>
    )
}

export default MovieDescription
